import React from "react";
import s from "./";
import Title from "../../components/title/title";
import Text from "../../components/Text/text";

export default function Tech() {
  return (
    <div className={s.tech}>
      <Title text={"Mobile Technology"} />
      <div className={s.tech_info}>
        <Text
          text={"Milford Smith"}
          color={"#413E52"}
          fsize={20}
          fweight={400}
          fontFamily={"Inter"}
        />
        <Text
          text={"Technology in Sales: How Data is Powering Purchase Decisions"}
          fsize={13}
          color={"#868297"}
          fweight={400}
          fontFamily={"Inter"}
        />
      </div>
      <div className={s.tech_info}>
        <Text
          text={"Adell Jacobi"}
          color={"#413E52"}
          fsize={20}
          fweight={400}
          fontFamily={"Inter"}
        />
        <Text
          text={"Best Technology Podcast Episodes of 2020"}
          fsize={13}
          color={"#868297"}
          fweight={400}
          fontFamily={"Inter"}
        />
      </div>
      <div className={s.tech_info}>
        <Text
          text={"Lon Baumbach"}
          color={"#413E52"}
          fsize={20}
          fweight={400}
          fontFamily={"Inter"}
        />
        <Text
          text={"Integrate Big Data to Drive Informed, Agile Solutions"}
          fsize={13}
          color={"#868297"}
          fweight={400}
          fontFamily={"Inter"}
        />
      </div>
    </div>
  );
}
